import React from 'react';
import history from '../Config/history'

import ManagerCategory from '../views/Manager/ManagerCategory';
import ManagerFile from '../views/Manager/ManagerFile';
import ManagerJob from '../views/Manager/ManagerJob';
import ManagerNews from '../views/Manager/ManagerNews';
import ManagerUser from '../views/Manager/ManagerUser';
import CreateUser from '../views/Manager/create/CreateUser';
const routes =[
    {
        path:"/",
        exact:true
    },
    {
        path:"/manager",
        exact:true
    },
    {
        path:"/manager/category",
        exact:false,
        main:() => <ManagerCategory/>
    },
    {
        path:"/manager/file",
        exact:false,
        main:()=><ManagerFile/>
    },
    {
        path:"/manager/job",
        exact:false,
        main:()=><ManagerJob/>
    },
    {
        path:"/manager/news",
        exact:false,
        main:()=><ManagerNews/>
    },
    {
        path:"/manager/user",
        exact:true,
        main:()=><ManagerUser/>
    },
    {
        path:"/manager/user/add",
        exact:true,
        main:()=><CreateUser/>

    },
    {
        path:"/manager/user/:id/edit",
        exact:false,
        main: ({match,history})=> <CreateUser match={match} history={history}/>
    }



]
export default routes
